#!/usr/bin/env python

""" This is a self generating file.  Run it to refresh the recycle.exe data. """

import base64, re

recycle = base64.b64decode('''''')

if __name__ == '__main__':
    s = base64.b64encode(open('recycle.exe').read())
    module = open('Recycle.py').read()
    module = re.compile(r'^recycle = .+$', re.M).sub(r"recycle = base64.b64decode('''%s''')" % s, module)
    open('Recycle.py','w').write(module)
